Setor gerador de renda e emprego, segundo a SEI em 2014, ano que a Mineradora estava em pleno funcionamento, 1/3 dos empregos formais na iniciativa privada em Itagibá vieram da agropecuária, contribuindo com PIB do município, população rural é de 37% acima da média estadual, densidade populacional de 18,77 hab./km² ou seja #Itagiba segundo o IBGE é considerada uma cidade #rural
Com uma taxa de desocupação de 19,3% deveria ser uma preocupação da gestão pública gerar emprego e desenvolvimento principalmente através da #agropecuaria com isso não poderia deixar de reivindicar junto à Seagri o aporte necessário ao desenvolvimento do setor, comprovadamente a Agropecuária é o setor que mais cresce no Brasil e em Itagibá, aqui nós já temos um entreposto de CARNES com capacidade pra 50 carcaças, Leilões de renome, #Equiprovas, #Cavalgadas comprovando sua pujança e a nossa vocação.
Pude citar que Itagibá possui o maior rebanho bovino da região com mais de 70.000 cabeças de #gadodecorte e de #leite é uma grande bacia leiteira estabelecida, além de obter importantes criadores de #cavalos premiados da raça #mangalargamarchador #Ovinos Santa Inês, #Apicultura e #Piscicultura na #agriculturafamiliar
De olho no presente e no futuro a reunião foi pautada na construção do Centro de Comercialização de Animais para que o produtor possa não só comercializar seus animais, mas também visualizando dinamizar o setor dando possibilidade ao pequeno produtor de interagir com outros produtores, o FRIGORÍFICO com objetivo de manter os empregos daqueles que trabalham no setor de carnes e gerando outros novos postos de trabalho aliado a sanidade e o tão sonhado PARQUE DE EXPOSIÇÕES reunindo entretenimento, feiras, cursos e exposições mostrando tudo que #Itagibá tem de melhor. (Dados até 2016)";}i:17;a:1:{s:14:"comments_count";i:0;}i:18;a:1:{s:11:"likes_count";i:0;}i:19;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEu-O6_BvPq";}i:20;a:1:{s:5:"image";s:238:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/118824597_121351113016966_8457128930394570022_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=110&_nc_ohc=i7hFz4MmP4oAX-bRFFf&oh=6a5b65085ad23abb2e18051ffba99f42&oe=5F7DEE46";}i:21;a:1:{s:4:"type";s:5:"image";}i:22;a:1:{s:8:"owner_id";i:2200623264;}i:23;a:1:{s:14:"owner_username";s:0:"";}i:24;a:1:{s:14:"owner_fullname";s:0:"";}i:25;a:1:{s:9:"owner_pic";s:0:"";}i:26;a:1:{s:2:"id";s:19:"2391122018931110405";}i:27;a:1:{s:10:"short_code";s:11:"CEu-M65APIF";}i:28;a:1:{s:12:"created_time";i:1599263978;}i:29;a:1:{s:7:"caption";s:443:"Sacos para entulho!
